import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="link-servizi">
          <div className="link-chi-siamo">Chi Siamo</div>
          <div className="link-lavorazioni">Lavorazioni</div>
          <div className="link-contatti">Contatti</div>
          <div className="language-selector">IT</div>
        </div>
      </header>
      <body className="App-body">

      </body>
    </div>
  );
}

export default App;
